import { useQuery } from "react-query";
import { fetchCoinTickers } from "../api";
import styled from "styled-components";

const PriceBox = styled.div`
    border: 1px solid black;
    width: 50%;
`

interface PriceData {
    id: string;
    name: string;
    symbol: string;
    rank: number;
    circulating_supply: number;
    total_supply: number;
    max_supply: number;
    beta_value: number;
    first_data_at: string;
    last_updated: string;
    quotes: {
        USD: {
            ath_date: string;
            ath_price: number;
            market_cap: number;
            market_cap_change_24h: number;
            percent_change_1h: number;
            percent_change_1y: number;
            percent_change_6h: number;
            percent_change_7d: number;
            percent_change_12h: number;
            percent_change_15m: number;
            percent_change_24h: number;
            percent_change_30d: number;
            percent_change_30m: number;
            percent_from_price_ath: number;
            price: number;
            volume_24h: number;
            volume_24h_change_24h: number;
        }
    };
}

interface PriceProps {
    coinId: string;
}

function Price( {coinId}: PriceProps){
    const { isLoading, data } = useQuery<PriceData>(["ohlcv", coinId], () => fetchCoinTickers(coinId))
    return (
        <div>{isLoading ? "Loading..." :
            <section>
            <PriceBox>{data?.id}</PriceBox>
            <div>{data?.quotes.USD.percent_change_15m}</div>
            <div>{data?.quotes.USD.percent_change_30m}</div>
            <div>{data?.quotes.USD.percent_change_1h}</div>
            <div>{data?.quotes.USD.percent_change_6h}</div>
            <div>{data?.quotes.USD.percent_change_12h}</div>
            <div>{data?.quotes.USD.percent_change_24h}</div>
            <div>{data?.quotes.USD.percent_change_7d}</div>
            <div>{data?.quotes.USD.percent_change_30d}</div>
            <div>{data?.quotes.USD.percent_change_1y}</div>
            <div>{data?.quotes.USD.market_cap_change_24h}</div>

            </section>
    }</div>
    )
}

export default Price;
